import "core-js/modules/es.array.push.js";
export default {
  data() {
    return {
      IsShow: false,
      isShowList: []
    };
  },
  methods: {
    setIsShow(i) {
      if (this.isShowList.includes(i)) {
        this.isShowList = this.isShowList.filter(item => item !== i);
        return;
      }
      this.isShowList.push(i);
    }
  },
  computed: {
    getFAQ() {
      return this.$store.getters["playerMenu/getFAQ"];
    }
  }
};
